import React from 'react'
import {withCharacter} from './MyProvider'
import {Link} from 'react-router-dom'

function Info(props) {
    let {name, house, id} = props
    return(
        <div>
            <h2>{name}</h2>
            <a href={`http://localhost:3000/info/${id}`}>{id}</a>
            <h4>{house}</h4>
        </div>
    )
}

export default withCharacter(Info)
